import React from 'react'

const Login = () => {
  const navigate = useNavigate();
  const goLoginPage = () => {
    navigate('/login');
  }

  return (
    <>
      <h1>BOX</h1>
      <button onClick={goLoginPage}>NAVER</button>
      <button>카카오톡</button>
      <button>Apple</button>
      <button>로그인</button>
      <Link to="/join">가입하기</Link>
    </>
  )
}

export default Login
